
function moreButtonOn(a,b){a.color="#040b25";a.backgroundColor="white";b.display="block"}function moreButtonOff(a,b){a.color="";a.backgroundColor="";b.display="none"}moreMenuOnclickHandler=function(a,b){return function(){if(b.display!=="none"){moreButtonOff(a,b)}else{moreButtonOn(a,b)}}};function setupMoreMenu(){var a=document.getElementById("show_navbar").querySelector("a").style;var b=document.getElementById("navbar_more").style;moreButtonOff(a,b);document.getElementById("show_navbar").onclick=moreMenuOnclickHandler(a,b)}function executeMobileJavascript(){var b=document.getElementsByClassName("text_link");for(var a=0;a<b.length;a++){b[a].className+=" mobile"}}function runJavascript(){if("ontouchstart" in window){executeMobileJavascript()}setupMoreMenu()}runJavascript();